import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <div style={{ backgroundColor: "transparent" }}>
      <nav className="navbar navbar-expand-lg" style={{ backgroundColor: "transparent" }}>
        <div className="container-fluid" style={{ backgroundColor: "transparent" }}>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            {/* Replace the 'Link' component with an 'a' tag for now */}
            <a
              className="btn"
              id="signIN"
              href="/signin" // Replace this with the appropriate URL
              style={{ backgroundColor: "#CF4FB1" }}
            >
              Sign In
            </a>
            <button
              className="btn mx-2"
              id="login"
              type="button" // Change 'submit' to 'button'
              style={{ backgroundColor: "#30DBD3" }}
            >
              Login
            </button>
          </div>
        </div>
      </nav>
    </div>
  );
}
